L'anno Mille Ottocento Undici il di trenta Gennaio [...]
Son comparsi Vincenzio Vinci d'anni ventisei Fornaciaio del Popolo di S: Michele a Ronta Comune di Borgo S: Lorenzo, Padre del infrascritta defunta, e Antonio Modi d'anni trentuno Macellaro della Terra popolo e Comune del Borgo S. Lorenzo, conoscente della defunta medesima i quali ci hanno dichiarato che all ore Sette di Sera del giorno antecedente L'annunziata Erminia Vinci nella sua età di giorni quattro e Morta nella Casa posta in Luogo detto Rialto nel Popolo di S: Michele a Ronta Comune di Borgo S: Lorenzo

Adì 6. Aprile 1815. 
M.ª Luisa Giuditta di Giovan Batta dl fù Francesco Viviani e dlla M.ª Alessandra di Niccolò Gigli s.l.c. nata alle ore cinque pomeridiane del precedente. Com.e Agata mog.? di Luigi Niccoli: tutti di Ronta. Batt.ò il Cappell.º Sartoni.
